import React from "react";
import styled from "styled-components";

export const Container = styled.div`
  background-color: grey;
  border: red solid 1px;
  position: absolute;
  top: 0;
  left: 0;
  width: 500px;
  max-width:100vw
  height: 100%; /* 100% of body */
`;
